import AOS from 'aos';
import './app.css'
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';


const App = ({ children }) => {
  AOS.init()
  return (
    <>
      <Header />
      {children}
      <Footer />
    </>
  )
}

export default App
